import "./App.css";
import { useEffect, useState } from "react";
import { getNewStoryIds, getStoryWithID } from "./APICalls/getApiStories";

import { StoryTemplate } from "./WebsiteElements/storyTemplate";

const App = () => {
  const [newStories, setnewStories] = useState([]);
  const [story, setStory] = useState([]);

  useEffect(() => {
    getNewStoryIds().then((stories) => {
      setnewStories(stories);
    });
    //console.log(newStories);

    getStoryWithID(newStories[0]).then((storyd) => {
      setStory(storyd);
    });
    console.log(story);
  }, []);

  return <main>{newStories.map((storyId) => StoryTemplate(storyId))}</main>;
};

export default App;

